The Public Lands Boundaries database contains known titles, acres, city, county,
quad, type, source and verified fields. Known areas are of City parks, Local
parks, County Parks, Parks, Wayside parks, Recreational and Public Use Area,
State Parks, Natural Areas, National Wildlife Refuge, Wildlife Management Area,
Wildlife Demonstration Area, Wilderness Area, National Historic area and
Military Reservation areas. Cell placed at known location with indeterminate
boundary and all boundaries have been edited for AHTD needs. Verification from
AHTD field visits and various officials review of boundary map. Acreage
information interpolated from aerial maps with and without elevation
information, some with and without road systems, some AGFC boundary map
information, and City Parks data.
Source information and reference information: from AHTD data, and AHTD field
visits, AGFC Officials, some AGFC digital data and AGFC boundary maps, State
Park Officials and some ARSP digital data, some City Officials, City Park
Officials and FAYgis and PAgis, NWR Officials and NWR boundary maps, Arkansas
Heritage Natural Areas boundary map and digital data, Topographic data, and Army
Corps of Engineers.

For reference purposes this file depicts and attributes Arkansas public lands.
The database may help assist City, County, State and AHTD projects. The
reference of the dataset may help assist in assessment of proximity of greenways
and public lands; and to have an inventory of Arkansas Public Lands for the
dissemination to the public.



